import React from "react";
import "./Footer.css";

const Footer = props => {
    return(
      <span>
      <div class="content">
      <h1>Sticky Footer with calc()</h1>
      <p><button id="add">Add Content</button></p>
    </div>

    <footer class="footer">
      Footer 
    </footer>
    </span>
    )
}

export default Footer;
